import React, { useState } from 'react';

import AuthenticatedPosts from './AuthenticatedPosts';
import UnauthenticatedPosts from './UnauthenticatedPost';

const Posts = () => {
  const [posts, setPosts] = useState([]);
  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("");
  const [price, setPrice] = useState("");
  const [location, setLocation] = useState("");
  const [willDeliver, setWillDeliver] = useState(false);
  
  const userToken = localStorage.getItem("userToken");
  return (
    <>
      {
        userToken ? <AuthenticatedPosts posts={posts} setPosts={setPosts}
          title={title} setTitle={setTitle}
          description={description} setDescription={setDescription}
          price={price} setPrice={setPrice}
          location={location} setLocation={setLocation}
          willDeliver={willDeliver} setWillDeliver={setWillDeliver} /> : <UnauthenticatedPosts />
      }
    </>
  )
}

export default Posts;
